import React from 'react';

function GitHubLink() {
    return (
        <div>
            <link>
                <a href='https://github.com/timdavidharris/book-shelf-react-app' target='_blank' rel="noopener noreferrer" >
                    GitHub Link
                </a>
            </link>
        </div>
    )
}

export default GitHubLink;
